import java.util.HashMap;
import java.util.Map;

public class IsAnagram {
    public Map<Character,Integer> getMap(String s){
        char[] c = s.toCharArray();
        Map<Character,Integer> map = new HashMap<>();
        for(int i = 0;i<c.length;i++){
            if(map.containsKey(c[i])){
                map.put(c[i],map.get(c[i])+1);
            }else{
                map.put(c[i],1);
            }
        }
        return map;
    }
    public boolean isAnagram(String s,String t){
        if(s.length()!=t.length()){
            return false;
        }
        Map<Character,Integer> smap = getMap(s);
        Map<Character,Integer> tmap = getMap(t);
        char[] ch = s.toCharArray();
        System.out.println(ch.length);
        for(int i = 0;i<ch.length;i++){
            if(!smap.get(ch[i]).equals(tmap.get(ch[i]))){
                System.out.println("s中:"+ch[i]+"出现次数："+smap.get(ch[i]));
                System.out.println("t中:"+ch[i]+"出现次数："+tmap.get(ch[i]));
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        IsAnagram ia =new IsAnagram();
//        System.out.println(ia.isAnagram("abdhsw","awsdb"));
        System.out.println(ia.isAnagram("",
                ""));
    }
}
